import React from "react";
import AddUser from "./components/AddUser";
import UserList from "./components/UserList";

function App() {
  return (
    <div style={{ padding: 20 }}>
      <UserList />
      <AddUser onUserAdded={() => window.location.reload()} />
    </div>
  );
}

export default App;
